import React, { Component } from "react";
import './About.css';

class About extends Component {
  render() {
    return (
      <div className="about-container">
        <h2>About</h2>
        <p>Mauris sem velit, vehicula eget sodales vitae,
        rhoncus eget sapien:</p>
      </div>
    );
  }
}

export default About;
